INSERT INTO `v9_news_data` VALUES('6','&nbsp;经历了谨小慎微的学徒期，度过了渐渐熟悉的起步阶段，当初步适应了工作、适应了岗位后，许多80后忽然有一天发现自己陷入了职业发展的瓶颈中。<br />
&ldquo;瓶颈&rdquo;是阻碍，也是机会 瓶颈局面虽然令人烦闷，但在职场上却是普遍存在，几乎人人都曾遇到过。换个角度看，遇到瓶颈并不是什么坏事。首先，感到瓶颈状态带给自己烦躁、郁闷，说明自己还没有麻木，还拥有感觉。拥有感觉，则说明对自己的职场生涯还有期望、还有梦想。这样看来，瓶颈恰恰是催促自己主动思考的一个契机。<br />
提升竞争力，不做万金油当瓶颈出现，首要任务是了解瓶颈产生的原因。最常见的是级别上暂时无法提升和改变。职业成功的关键，在于工作经验的质量要高，经验丰富必须体现在个人职业核心竞争力上的积累。因此选择工作岗位时，要时刻保持专业技能成长的连贯性，保持个人职业能力水平的可持续发展。<br />
重新定位，不做没头苍蝇&nbsp; 度过职场新人期，对环境、对自己有了一定基本了解之后，及时制定准确的职业定位和职业规划是根本。<br />
随时充电，综合发展 在信息爆炸的今天，如果缺乏持续的学习，很快就会因知识结构的老化而面临淘汰，这种尴尬也是出现职场瓶颈的原因之一。因此，有意识地进行充电，保持自身职场竞争力，是突破瓶颈的有效手段。&nbsp;<br />
','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('7','&nbsp;In order for the DVR to communicate with an internet connection so that the DVR interface can be viewed online or from a smartphone, the DVR must be connected to a router. &nbsp;Typically, the DVR must be hard-wired using a LAN internet cable, but Netgear produces an adapter that can allow your DVR to communicate wirelessly with your router.<br />
&nbsp;<br />
The adapter you&#39;ll need to make your DVR wireless is the&nbsp;NETGEAR- Universal Wi-Fi Wireless-N Dual Band USB Adapter (Netgear Part Number&nbsp;WNCE3001)<br />
&nbsp;<br />
What sets this device apart from other wireless network adapters is that it does not require any drivers to be downloaded to the device that you are connecting it to. &nbsp;Other WiFi adapters will not work because your DVR is not capable of downloading the necessary drivers that other WiFi adapters need.<br />
&nbsp;<br />
We tested the Netgear&nbsp;WNCE3001 in house using an NVR, older model DVR, and newer model DVR. &nbsp;The device always connects with no issues.<br />
&nbsp;<br />
The Netgear&nbsp;WNCE3001 will work on both WPS routers and non-WPS routers.<br />
&nbsp;<br />
You will still need a router connected to an active internet connection. &nbsp;This device will not connect your DVR with 3G or 4G networks, and it cannot connect your DVR to your neighbor&#39;s unsecured WiFi network.','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('8','&nbsp;&nbsp;
<ul>
<li>睡前放松你的神经在你入睡1小时前关掉电视。看电视会刺激你的大脑，让它处于难以入眠的状态。整晚睡不好的精神状态，相当于血液里酒精含量达到醉酒驾车的程度。</li>
<li>电话放在一起打早上的时候，不要接电话，全部用语音留言，然后一起听完了之后，再一一回复。这样可以避免你在需要专心做一件事情的时候被不断打扰。</li>
<li>每六个月检查一下你的电脑查杀病毒、删除过期文件、清理碎片、安装需要的软件，同时也卸载不必要的软件。2005年的一项调查发现，很多上班族平均每天需要用48分钟来专门处理电脑问题。</li>
<li>固定你的工作流程把下属汇报工作的时间，头脑风暴时间，或是监督工作进度的时间，都固定在每天的某个时段内。这样就不会有人时不时来打断你的工作。</li>
<li>知道自己何时效率最高很多人都在早上的时候工作效率最高，可如果你的生物钟稍微靠后了一些，不妨晚一点去吃中午饭，趁办公室里的安静状态，进行工作。</li>
<li>按计划行事每天列一个日程表，列出写邮件、打电话的时间。人们习惯于确定开会的时间，但对于自己一整天的工作却缺少具体的时间安排。如果觉得开会比日常工作还重要，那么只会造成各种阻碍。</li>
</ul>
','0','','0','10000','','0','','0','1','|0');
