INSERT INTO `v9_news_data` VALUES('13','<span style=\"font-size: 16px\"><span style=\"font-family: trebuchet ms, helvetica, sans-serif\">The Friday after Thanksgiving, although not a Federal holiday, is a holiday for many companies, except for those in retail. It is also a day off for most schools. It is popularly known as Black Friday, so-called because of the heavy shopping traffic on that day. Another reason for the term &#39;Black Friday&#39; is that many stores reach sales numbers that take them out of the red and (hopefully) keep them in the black for the rest of the fiscal year. Black Friday is considered to be the start of the Christmas shopping season.<br />
The term &quot;Black Friday&quot; is said to have originated in Philadelphia during the 1960s to describe the difficulty of police and drivers to deal with exceptionally heavy traffic on that day as shoppers flooded the city&#39;s commercial center。<br />
The phrase was later co-opted by retailers to refer to the holiday shopping period as a time of year when their business moves into the black, or turns a profit。</span></span>','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('14','&nbsp;你是否有时间管理不良的征兆？看看一下这些问题。<br />
