<div>2.你是否因为顾虑其它的事情，而无法集中精力来做目前的事？</div>
<div>3.如果工作被中断，你是否特别生气？</div>
<div>4.你是否每天回家的时候都是筋疲力尽，有觉得好像没做什么事情？</div>
<div>5.你是否觉得老是没有什么时间做运动或者是休闲，甚至是只是随便玩玩都没有时间？</div>
<br />
对于以上的这些问题，只要有两个回答是&ldquo;是&rdquo;的话，那你的时间管理就有问题了。<br />
<br />
<a href=\"http://zone.zmodo.com/cms/uploadfile/2012/1129/20121129013504887.pptx\">http://zone.zmodo.com/cms/uploadfile/2012/1129/20121129013504887.pptx</a><br />
<br />
