INSERT INTO `v9_news_data` VALUES('15','破阵子&middot;为陈同父赋壮语以寄<br />
<br />
辛弃疾<br />
<br />
醉里挑灯看剑，梦回吹角连营。八百里分麾下炙，五十弦翻塞外声，沙场秋点兵。 马作的卢飞快，弓如霹雳弦惊。了却君王天下事，赢得生前身后名。可怜白发生！<br />
<br />
这是辛弃疾寄给陈亮（字同甫）的一首词。陈亮是一位爱国志士，一生坚持抗金的主张，他是辛弃疾政治上、学术上的好友。他一生不得志，五十多岁才状元及第，第二年就死了。他俩同是被南宋统治集团所排斥、打击的人物。宋淳熙十五年，陈亮与辛弃疾曾经在江西鹅湖商量恢复大计，但是后来他们的计划全都落空了。这首词可能是这次约会前后的作品。<br />
<br />
这词全首都写军中生活，也可以说是写想象中的抗金军队中的生活。上片描写在一个秋天的早晨沙场上点兵时的壮盛场面。开头两句写军营里的夜与晓，&ldquo;醉里挑灯看剑&rdquo;一句有三层意思：&ldquo;看剑&rdquo;表示雄心，&ldquo;挑灯&rdquo;点出时间，醉里还挑灯看剑是写念念不忘报国。次句&ldquo;梦回吹角连营&rdquo;，写拂晓醒来时听见各个军营接连响起雄壮的号角声。上句是看，此句是闻。接下三句写兵士们的宴饮、娱乐生活和阅兵场面，词的境界逐渐伸展、扩大。&ldquo;八百里分麾下炙&rdquo;，八百里炙是指烤牛肉。《晋书》载：王顗有牛名八百里，常莹其蹄角，王济与王顗赌射得胜，命左右探牛心作炙。&ldquo;麾&rdquo;是军旗。全句的意思是：兵士们在军旗下面分吃烤熟的牛肉。&ldquo;五十弦翻塞外声&rdquo;，指各种乐器合奏出雄壮悲凉的军歌。古代的瑟有五十弦。李商隐诗：&ldquo;锦瑟无端五十弦。&rdquo;这词里的&ldquo;五十弦&rdquo;，当泛指合奏的各种乐器。&ldquo;翻&rdquo;，指演奏。&ldquo;塞外声&rdquo;，指雄壮悲凉的军歌。<br />
<br />
下片写投入战斗的惊险场面：&ldquo;马作的卢飞快&rdquo;，&ldquo;的卢&rdquo;，骏马名。相传三国刘备在荆州遇厄，的卢马载着他一跃三丈，越过檀溪（《三国志&middot;先主传》引《世说》）。&ldquo;作&rdquo;，作&ldquo;如&rdquo;解。&ldquo;弓如霹雳弦惊&rdquo;，比喻射箭时弓弦的响声如雷震。&ldquo;了却君王天下事&rdquo;两句，描写战斗获胜，大功告成时将军意气昂扬的神情。&ldquo;天下事&rdquo;指收复中原。收复中原，不仅是君王的事，也是人民共同关心的大事。末句一结，却转到在南宋统治集团的压抑下，恢复祖国河山的壮志无从实现的悲愤。这一转折，使上面所写的愿望全部成为幻想，全部落空。<br />
<br />
这首词题是&ldquo;壮词&rdquo;，前面九句的确可称得上是壮词，但是最后一句使全首词的感情起了变化，使全首词成为悲壮的而不是雄壮的。前面九句是兴高采烈、雄姿英发的。最后一句写出了现实与理想的大矛盾，理想在现实生活中的幻灭。这是辛弃疾一生政治身世的悲愤，也同样是陈亮的悲愤。','0','','0','10000','','0','','0','1','|0');
