INSERT INTO `v9_news_data` VALUES('20','<h3>What is &quot;Supervision&quot;?</h3>
<p>There are several interpretations of the term &quot;supervision&quot;, but typically supervision is the activity carried out by supervisors to oversee the productivity and progress of employees who report directly to the supervisors. For example, first-level supervisors supervise entry-level employees. Depending on the size of the organization, middle-managers supervise first-level supervisors, chief executives supervise middle-managers, etc. Supervision is a management activity and supervisors have a management role in the organization.</p>
<h3>What Do Supervisors Do?</h3>
<p>Supervision of a group of employees often includes<br />
1. Conducting basic management skills (decision making, problem solving, planning, delegation and meeting management)<br />
2. Organizing their department and teams<br />
3. Noticing the need for and designing new job roles in the group<br />
4. Hiring new employees<br />
5. Training new employees<br />
6. Employee performance management (setting goals, observing and giving feedback, addressing performance issues, firing employees, etc.)<br />
7. Conforming to personnel policies and other internal regulations</p>
','0','','0','10000','','0','','0','1','|0');
