INSERT INTO `v9_news_data` VALUES('23','<div style=\"text-align: center\"><u><span style=\"font-size: 14px\"><strong><a href=\"http://www.baidu.com/link?url=97Q_GJqjJ4zBBpC8yDF8xDhctjCdK9s5SmUAbEkSMtba4Zi\" target=\"_blank\"><span style=\"color: #ff0000\">如果要飞得高,就该把地平线忘掉!!!</span></a></strong></span></u></div>
&nbsp;<br />
今天早上上班前，电视机里放着刘德华的演唱会，一句&ldquo;如果要飞得高,就该把地平线忘掉&rdquo;的歌词，使我猛然一惊，想着两个问题：什么是智美达的&ldquo;飞得高&rdquo;？什么是智美达的&ldquo;地平线&rdquo;？<br />
联系到实施我们的&ldquo;飞鹰&rdquo;行动，我们必须在理解&ldquo;飞得高&rdquo;的同时，找到并忘掉随时随地发生在我们身边的&ldquo;地平线&rdquo;。希望通过此短文，让我们一起来晒晒智美达目前面临的&ldquo;地平线&rdquo;：<br />
<br />
1. 不思进取：不知道目标何在，不清楚明日为何；<br />
2. 保守盲目：不相信公司，不相信自己；<br />
3. 抱残守缺：习惯于过去的经验，不能与时俱进：<br />
4. 领导没时间，员工没工作：管理混乱，主次不分；<br />
5. 反映迟钝：对行业，对专业的快速发展麻木不仁，不提高，不进步；<br />
6. &ldquo;不争第一&rdquo;：事不关己，高高挂起；<br />
7. 。。。。。<br />
<br />
歌德有句名言：&ldquo;最好不是在夕阳西下的时候幻想什么,而是在旭日初升的时候即投入行动。&rdquo;智美达正处于旭日东升之时，希望我们抬起头，放眼天空的浩渺，冲破&ldquo;地平线&rdquo;的阻挠，昂扬起飞、飞得更高吧！<br />
&nbsp;<br />
万克家<br />
&nbsp;<br />
2013年1月20日星期日','0','','0','10000','','0','','0','1','|0');
