INSERT INTO `v9_news_data` VALUES('46','<br />
&nbsp; &nbsp; &nbsp;&nbsp; &ldquo;热烈祝贺我司内网新版块&mdash;&mdash;《公司周刊》全面上市，随着公司不断壮大，机遇和挑战如影随形，但我们从不畏惧，勇敢前行。希望大家积极阅读，了解公司发展近况和行业动态，更好的执行，更快的成长。公司在快速发展，不断变化，《公司周刊》向大家展示最新的公司战略走向、产品发布、人才计划、销售概况、投资项目等，为大家提供一个信息共享的平台。知晓公司动态，紧跟公司前进步伐。同时通过对行业动态的浅析，不断的完善我们的产品线规划和未来的发展模式，让每一位智美达人都坚信，选择了智美达，会是你一生最正确的抉择。当然每个智美达人都应该不断的增强自己的责任感、使命感，拥有主人翁精神。在不断学习、进步和完善的过程中，加强自我管理意识，培养自己的团队建设能力。&rdquo;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-size:14px;\"><strong> &nbsp; &nbsp;&nbsp; &mdash;&mdash; CEO 万克林</strong></span><br />
&nbsp;<br />
<ul>
<li><span style=\"font-size:16px;\"><strong>公司动态</strong></span></li>
</ul>
<br />
<ol>
<li><strong>新品发布</strong></li>
</ol>
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 我们的最新力作-720P 高清IP无线摄像机已经面向市场进行销售。其小巧、灵活、无线传输、高清画质、二维码扫描等特色已经吸引了很多客户的眼球。目前eBay, Amazon, Web等平台都已上线，国内市场也正在推广。期待着，精彩必将属于我们。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img alt=\"\" src=\"data:image/png;base64,\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"data:image/png;base64,\" /><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
<ol>
<li value=\"2\"><strong>新产业园启动</strong></li>
</ol>
&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 盐城建厂项目已经落实，第二生产基地即将开土动工，其建筑面积是沙井工厂的8倍左右，我们的&ldquo;先行者&rdquo;已踏上征程，开展相关工作，包括过渡期厂房的方案设计、施工装修公司的确定、人员的招聘计划、盐城项目公司的建立等。<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 目前公司正处于重要转折期，需要大量的人才，机会已经摆在大家面前，你准备好了吗？<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"data:image/png;base64,\" /><br />
&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
<ul>
<li><span style=\"font-size:16px;\"><strong>行业动态</strong></span></li>
</ul>
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日大华股份利用&ldquo;绿色安防&rdquo;这一主流话题，推出了&ldquo;低照度、低码流、低功耗&rdquo;的高清网络摄像机。绿色环保、安全防护正是我们正在进行的产品规划，也是当下深入人心的热点名词，顺应市场发展，持续产品创新，挖掘自身优势，相信ZMODO成为享誉全球的知名品牌也为时不远了。<br />
&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; 最近Hikvsion发布关于助力贵州黄果树瀑布可视化管理项目的新闻。由此可知，旅游业在安防领域的应用也在大量普及，综合管理平台、景区客流量统计、行为分析、无缝拼接、卡口等系列产品加强了景区管理的可控性和简易化。<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 我们的未来空间无限，机遇无限，更多的技术整合，更好智能应用，我们正在实现。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"data:image/png;base64,\" /><br />
<ul>
<li><span style=\"font-size:16px;\"><strong>全球资讯</strong></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>
</ul>
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 据《华尔街日报》报道，一些全球大的手机制造商和运营商正在寻找第三种手机操作系统，示意挑战苹果的IPHONE和谷歌的ANDROID系统。Mozilla公司预计搭载火狐操作系统的设备将于今年夏天首先在哥伦比亚、波兰、西班牙和委内瑞拉推出。火狐系统基于HTML5技术，可以更容易的与移动浏览器整合，同时也压低了运行所需的硬件成本。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"data:image/png;base64,\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"data:image/png;base64,\" /><br />
<br />
&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; 移动终端市场风云变幻，对安防电子行业是一个挑战。随着移动终端特别是智能终端的应用普及，移动监控已成为当今热点，并衍生出智能终端安防应用这一新兴产业，前景可观。未来更多的安防应用新概念及新模式将会推出，对我们来说是机遇，更是挑战。怎样才能持续创新，始终走在市场尖端，值得我们每一个人深思。<br />
&nbsp;','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('47','<br />
<span style=\"font-size:16px;\"><strong>公司动态&mdash;&mdash;落实与执行</strong></span><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;细节决定成败&rdquo;，&ldquo;停止空谈、开始行动&rdquo;，&ldquo;Just do it&rdquo;等名言警句我们都已耳熟能详,而真正将理论付诸于实际并不简单。我们的新产品刚刚上市，要想占领市场，独领风骚？必须依靠一流的执行力！而执行力问题是目前困扰我们各部门的瓶颈。电商部门如何增加销售业绩？研发部门如何改进用户体验？工厂如何按时交货保证质量？人事部门如何招贤纳士，提升员工素质？执行力的提升迫在眉睫。提升执行力，各部门的改进势在必行。改进要落到实处，上至组织流程的优化，如公司网站的页面优化及功能设计、新产品推广的流程制定，人才的培养和储备计划，基于用户体验的研发流程制定，监督机制的完善等；下至个人工作能力和思维视野的拓展，如加强细节关注度，提升用户体验意识等。执行力的提升是一个循序渐进的过程，不可能一步到位，而我们从现在开始，从自己做起，关注每一个细节的改进，才能逐步提升个人的执行力。而要提升部门乃至企业的整体执行力，光靠改进还不够，大刀阔斧的改革也很必要。 而改革之路，任重道远，需要我们特别是管理干部深思。<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 今年是公司取得突破性进展的关键，挑战无处不在，我们需要在持续改进的基础上，勇于改革，不断提升执行力。<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; <img alt=\"\" src=\"data:image/png;base64,\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <img alt=\"\" src=\"data:image/png;base64,\" /><br />
&nbsp;<br />
<strong><span style=\"font-size:16px;\">行业动态&mdash;&mdash;大数据与网络安全</span></strong><br />
&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 伴随着平安城市项目的大力推广、智能家居热点的不断升温，视频监控市场正在进行转变，由模拟监控走向网络监控时代。很庆幸的是我们已走在市场尖端，推出了新产品线。大势所趋，数据量的不断膨胀，势必带来储存的又一轮升级，当然也会引来网络安全的一个担忧。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img alt=\"\" height=\"230\" src=\"data:image/png;base64,\" width=\"519\" /><br />
&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 网络安全问题将会导致存储技术和存储方式的变革。现在的市场正在初步向NVR、NVS、IPSAN等网络存储发展，将来的发展方向是云存储。同时视频监控的价值将逐步转向软件。在大数据时代，我们的竞争优势要从硬件向软件转变，主要比拼的是技术的实力、集成的实力、创新的实力、服务的水平，机遇已经来临，要时刻准备着，接受挑战。<br />
<br />
<strong><span style=\"font-size:16px;\">全球资讯&mdash;&mdash;移动导航成为热宠</span></strong><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日数字地图公司高德发布公告，阿里巴巴集团将斥资2.94亿美元收购高德28%的股权，这两家公司将展开合作以及对数据进行整合，开发以智能手机用户实际位置信息为基础的电子商务产品；同时据知情人士报道，Facebook正在就收购移动导航应用公司Waze进行谈判，此交易估值高达10亿美元。移动导航应用，加强了电子商务平台的优势，扩大了社交网络的规模，毋庸置疑已成为了当下的热宠。<br />
&nbsp; &nbsp;&nbsp;<br />
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img alt=\"\" src=\"data:image/png;base64,\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img alt=\"\" src=\"data:image/png;base64,\" /><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" height=\"153\" src=\"data:image/png;base64,\" width=\"242\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; <img alt=\"\" src=\"data:image/png;base64,\" /><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 对于安防领域，移动导航并不陌生，它是车载系统的一部分。实时监控、全方位定位、移动导航、娱乐通信势必会成为车载集成系统的未来蓝图。蓝图有待勾画，亲爱的智美达人，你准备好了吗？','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('49','<br />
<span style=\"font-size:16px;\"><strong>公司动态&mdash;&mdash;新款</strong><strong>Mini NVR KIT</strong></span><br />
&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; 我们公司自主研发的Mini NVR 即将面世销售，其以小巧的特点领跑整个安防市场。目前我们是首家推出MINI 版NVR 套包的公司，必将掀起一番热潮。Mini NVR KIT 采用&ldquo;1+2&rdquo;的形式，即NVR+2 * IP Camera, 已经率先在北美市场进行推广。其以安装便捷、无线传输、小巧精致等特点，引起了很多客户的关注。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; <img alt=\"\" height=\"233\" src=\"data:image/png;base64,\" width=\"375\" /><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &ldquo;专业化、普及化、集成化、简易化、大化、小化&rdquo;，是我们产品的核心与理念。Mini NVR KIT 正是&ldquo;普及化、简易化、小化&rdquo;的全方位诠释。我们未来的产品将更加贴近用户，贴近生活。同时ZMODO品牌正在逐渐向消费类产品转型，面对着激烈的市场竞争，我们一定会更加强大。<br />
<br />
<span style=\"font-size:16px;\"><strong>行业动态&mdash;&mdash;智能交通系统</strong></span><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日，平安城市建设成为了各国政府极力推广和倡导的名词。为了解决交通安全，交通堵塞和环境污染三大国际难题，智能交通系统自然而然的成为了备受关注的热点。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img src=\"http://zone.zmodo.com/cms/uploadfile/2013/0524/20130524094211409.png\" /><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 智能交通系统是构建平安城市的重要一环，是由交通信息服务系统、交通管理系统、公共交通系统、车辆控制系统、货运管理系统、电子收费系统、紧急救援系统等多个子系统组成。智能交通系统实现了对重点车辆的防范和控制，重点区域异常车辆的自动研判和预警，特定车辆行车轨迹的自动刻划，重要道路交通信息的远程再现等。<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 当然，未来的智能交通系统功能将更加完善，智美达也将会在这一领域大展宏图。期待着，未来每个平安城市都会留下智美达的LOGO。相信我们的共同努力，会让 ZMODO走入千家万户，会成为未来城市的守护者。<br />
&nbsp;<br />
<span style=\"font-size:16px;\"><strong>全球资讯&mdash;&mdash;</strong><strong>4G</strong><strong>时代</strong></span><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 自从2012年1月国际电信联盟正式审议通过了将中国主导制定的TDD-LTE-ADVANCED作为4G标准后，中国移动便完成了TD-LTE的规模试验测试工作。4G的网络覆盖有望超过100个城市，4G终端采购将超过100万部，建设超过20万个基站，覆盖超过5亿人口。网络建成后将成为全球最大的4G网络。由此可见2013年是&ldquo;4G 元年&rdquo;并非纸上谈兵。&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img src=\"http://zone.zmodo.com/cms/uploadfile/2013/0524/20130524094233886.png\" /><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 4G网络不仅带给用户更好的上网体验，也给移动互联网行业的发展带来更大的机遇。此外，移动4G网络所具备的独特优势还将辐射到更多不同的行业，包括无线监控领域以及物联网的诸多分支的应用，例如车联网、智能家居、智能交通、智慧城市等等。甚至移动4G网络在未来的城市管理、信息传输、应急指挥、交通调度等方面也拥有广泛的应用潜力，将使城市的现代化、信息化水平得到全面提升。<br />
','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('51','<br />
<span style=\"font-size: 16px\"><strong>一、公司动态&mdash;&mdash;江苏盐城之行</strong></span><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公司管理层及相关人员于2013年5月20日在江苏盐城市参加了智美达盐城项目的奠基仪式。未来，我们将在这里修建自己的工业园区，更多优质的ZMODO产品将由此运到全球，为我们的销售及发展奠定更坚实的基础。<br />
<br />
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; <img alt=\"\" height=\"203\" src=\"data:image/png;base64,\" width=\"153\" />&nbsp;&nbsp; <img alt=\"\" height=\"204\" src=\"data:image/png;base64,\" width=\"160\" /><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为了适应公司的高速发展需求，在基地建设完工之前，盐城政府为我司提供了过渡性生产厂房。 该厂房可使用面积要大于目前的沙井工厂。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"><img height=\"206\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0530/20130530082845531.jpg\" width=\"172\" /></a>&nbsp; &nbsp;<br />
&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 盐城项目周围配套设施齐备。科技绿洲是集休闲娱乐为一体的办公基地，在工作之余，可以打球、游泳、健身等；人才公寓环境舒适，分为蓝领公寓（四人间、两人间和单人间）和白领公寓（两室、三室和单间套房）。 生活配套齐<a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"> </a>全，包括食堂、咖啡厅、健身房、羽毛球馆、乒乓球馆、台球室等。&nbsp;&nbsp;&nbsp;<br />
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"><img height=\"130\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0530/20130530083145286.gif\" width=\"157\" /></a><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 随行人员还参观了悦达起亚生产车间、汉创公司，光电园区等，更加坚定了我们公司未来的发展方向，相信ZMODO的明天会更好。<br />
<br />
<strong><span style=\"font-size: 16px\">二、 行业动态&mdash;&mdash;新品推广之战</span></strong><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日，群晖Synoogy发布了最新版的CMS软件&mdash;&mdash;Surveillance Station. 实现了实时视频观看、事件播放、智能图像分析、用户权限管理、摄像机设置和授权、事件通知及电子地图等功能的高效率集中化管理。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"> <img height=\"99\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0530/20130530083733425.png\" width=\"132\" /></a><br />
<br />
&nbsp; &nbsp;&nbsp; &nbsp; 安讯士在5月29日宣布推出创新的直接驱动型HDTV PTZ半球摄像机，并计划于今年7月份通过安讯士分销渠道上市销售。此款产品以720P的分辨率、HDTV的高清画质、18倍的光学变焦、高效的云台系统等特色正在向安防行业的所有竞争对手发起挑战，一场无硝烟的战争即将打响。<br />
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"> <img height=\"116\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0530/20130530083419138.png\" width=\"138\" /></a><br />
&nbsp;&nbsp; &nbsp; &nbsp; 不管是软件的升级换代，还是产品的推陈出新，安防行业的战斗已经打响。胜负虽未定，但我们已经在积极备战。我们正在开发的IMS软件和投入研发的网络安防新产品，都将在智能监控领域发挥积极的作用。<br />
<br />
<span style=\"font-size: 16px\"><strong>三、</strong> <strong>全球动态&mdash;&mdash;多功能产品和单功能设备的对峙</strong></span><br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 如今，随着网络的不断普及化和加速化，可以联网的多功能设备已经成为最热销的消费类产品，比如平板电脑和智能手机。这些产品实现的是一种新的客户体验&mdash;&mdash;一种通过魔法般的电子技术和<br />
一些社交媒体给人带来一加一大于二的体验。<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 然而，持相反态度的人认为单功能设备依旧扮演着不可替代的角色，因为专业化的品质依然重要。例如，你不会看到专业摄影师使用安卓手机拍摄婚礼照片。<br />
&nbsp; &nbsp; &nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"><img id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0530/20130530084340256.png\" style=\"width: 190px; height: 126px; \" /></a>&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"><img height=\"124\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0530/20130530084432507.png\" width=\"198\" /></a>&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"><img height=\"125\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0530/20130530084457251.png\" width=\"185\" /></a><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 对于产品的发展，我们既秉承了专业化的品质，力求做到行业第一；又开拓了普及化的产品线，努力实现多功能设备的体验。所以，无论未来市场怎样风云变幻，我们终将立于不败之地。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ','0','','1','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('52','<br />
<strong><span style=\"font-size:16px;\">一、公司动态</span></strong><br />
&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 目前，我们的新品逐渐推向市场，已收到很多积极的回应。欧洲、澳洲等海外公司的成立，将ZMODO海外销售本地化运营，是公司品牌全球化的一个重要推进。同时，我们着力开拓的国内市场，也见起色。一方面，国内零售业务稳定增长；另一方面，政府合作项目也在持续推进。近日，洛阳市领导、山东汝山市领导和江西上饶县领导纷纷来我司参观考察，对ZMODO产品兴趣浓厚，有意开展&ldquo;平安城市、智慧小区、智能家居&rdquo;等项目的合作。我们坚信，随着公司全球化步伐的加快，ZMODO将会走进千家万户，成为家庭及城市的守护者<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"><img height=\"113\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0606/20130606083946949.jpg\" style=\"\" width=\"135\" /></a><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp;<br />
<strong><span style=\"font-size:16px;\">二、 行业动态</span></strong><br />
&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 随着数字时代的到来，安防产品也迈向数字化。网络摄像机成为当下热宠，很显然是时代的召唤。因为网络摄像机能够提供完整的监控系统解决方案，包括高像素、全景成像、断线录影和低光照性能等，已成为了中高端监控市场的明智选择。模拟摄像机经过多年的发展，已经成为很成熟的产品，市场也趋于饱和。从一个产品的生命周期来说，模拟摄像机正在由成熟向衰退期过渡，未来终将淡出市场。这不是预测，而是趋势。我们公司的产品发展方向也将顺应这一趋势，未来将推出更多更好的网络数字安防产品，力争成为市场的领跑者<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"><img height=\"113\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0606/20130606084108160.png\" style=\"cursor:hand\" width=\"135\" /></a><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 除了产品之外，ZMODO未来的竞争优势还将体现在一体化的服务模式及共享互通的数据理念。我们要从做产品到做服务，从卖价格到卖价值，从经营市场到经营客户。将ZMODO打造成为全球一流品牌。<br />
<br />
<span style=\"font-size:16px;\"><strong>三、 全球资讯</strong></span><br />
&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日， 美国国际贸易委员会裁定苹果公司产品侵犯了三星电子专利权，同时对苹果公司的一系列产品发出禁令，包括iPhone4、iPhone 3GS、iPad 3G、iPad 2 3G以及iPad 3，禁止进入美国市场。<br />
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp; <a href=\"javascript:void(0);\" onclick=\"flashupload(\'thumb_images\', \'附件上传\',\'thumb\',thumb_images,\'1,jpg|jpeg|gif|png|bmp,1,,,0\',\'content\',\'67\',\'96d53806cb54e2eaf720792e1415e1a6\');return false;\"> <img height=\"113\" id=\"thumb_preview\" src=\"http://zone.zmodo.com/cms/uploadfile/2013/0606/20130606084257310.png\" style=\"cursor:hand\" width=\"135\" /></a><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 虽然最终的结果还需要美国总统奥巴马的评估，但一诉的失败足以让苹果对专利权的保护和维护提起高度重视。专利权，作为公司发展的一个无形资产，起着至关重要的作用。专利权管理不善，给企业带来的不仅是无形的影响，还有有形的损失和潜在的危害。专利申请也是我们公司目前正在进行的重点工作。专利工程师的引进，将为我们未来的发展做好铺垫。','0','','0','10000','','0','','0','1','|0');
INSERT INTO `v9_news_data` VALUES('53','<br />
<strong><span style=\"font-size:16px;\">公司动态</span></strong>&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2013年，对于我们来说是突破性的一年，也是关键的一年。现在正值6月，回顾前半年的工作，我们收获累累：新产品的研发与推广，全球市场的开拓与建立，盐城工业园的落实与启动，公司战略的执行与改革，ZMODO品牌的定位与设计等等。展望下半年，任务依然繁重：新产品的功能完善与软件升级，ZMODO品牌营销与提升，全球业务的经营与推广，以及10月安博展与11月高交会的筹备等等，这是我们产品在国内的重要亮相，我们必须做好充分的准备。总之，这一切的工作都是为了圆梦-ZMODO腾飞之梦。只有做好现在的每一步，未来的道路才能更加顺畅。所以，每一个智美达人，都应该以主人翁的心态高效去执行每一项任务。相信，我们会很快驶向梦想彼岸。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" height=\"184\" src=\"data:image/png;base64,\" width=\"243\" /><br />
<br />
<span style=\"font-size:16px;\"><strong>行业动态</strong></span><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近日，新疆安防展在乌鲁木齐红光山国际会展中心举行。数百家国内安防企业参加了此次安防展，其中包括：海康威视、宇视科技、天地伟业等。目前，反恐是新疆安防市场最大的需求。同时，据相关部门初步预测，在未来三年，新疆的安防市场需求将超过百亿元。<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 这是一块很大的蛋糕，我们当然不能错过。西北市场的推广虽然还没有全面展开，但一直都是我们计划中的一块。就市场的形式来看，西北市场的专业类产品需求旺盛，民用类产品需求相对滞后。所以，对于ZMODO 品牌的打入，应考虑以专业化产品为主，民用化产品为辅的战略方针，进行差异化推广和销售，相信西北市场的攻下指日可待。<br />
<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" height=\"180\" src=\"data:image/png;base64,\" width=\"427\" /><br />
&nbsp;<br />
<strong><span style=\"font-size:16px;\">全球市场</span></strong><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 第二期《公司周刊》中，我们有提到关于移动导航成为热宠的话题。其中，Facebook 计划收购Waze成为了各方讨论的焦点。近日，谷歌公司证实已收购以色列地图导航公司Waze,以期整合Waze的实时地图数据来巩固谷歌地图的业务能力。同时，谷歌称，Waze产品研发团队将继续留在以色列，并暂时保持独立运营。','0','','0','10000','','0','','0','1','|0');
